MODIFIKASI HATI AYAM PADA SOSIS AYAM SEBAGAI SUMBER PANGAN TINGGI ZAT BESI UNTUK MENGATASI ANEMIA  DEFISIENSI ZAT BESI REMAJA PUTRI

<jats:p>Prevalensi anemia yang tinggi pada remaja putri di Indonesia menjadi faktor risiko melahirkan bayi stunting. Penyebabnya secara umum adalah kekurangan gizi besi. Program pemberian tablet tambah darah pada remaja putri belum menunjukkan hasil yang menggembirakan, sementara program pendidikan gizi melalui sekolah memerlukan biaya yang besar dan tidak dapat menjangkau seluruh remaja putri. Salah satu upaya adalah dengan menciptakan makanan yang mengandung tinggi zat besi yang disukai oleh remaja putri. Sebanyak 42,7% remaja menjadikan sosis sebagai pilihan makanan yang sering dikonsumsi. Bahan pangan sehari-hari yang tertinggi mengandung zat besi adalah hati ayam. Tujuan penelitian ini adalah untuk mendapatkan formula terbaik sosis hati ayam dalam sosis  ayam berdasarkan pengujian kandungan protein dan zat besi di laboratorium serta uji mutu hedonik sosis (evaluasi sensori) oleh remaja putri. Penelitian ini merupakan penelitian eksperimental murni dengan desain rancang acak lengkap. Penelitian menggunakan tujuh formula variasi hati ayam. Masing-masing formula akan diuji organoleptik, kadar air, protein dan zat besinya. Didapatkan formula terbaik yang sesuai tujuan penelitian adalah formula F2 dengan pertimbangan kandungan zat besi dalam setiap porsi paling mendekati AKG remaja putri. Formula terbaik perlu diuji-cobakan pada remaja putri anemia untuk melihat dampaknya pada peningkatan kadar hemoglobin darah.&#x0D;
 &#x0D;
Kata kunci : Anemia; Remaja putri; Sosis hati ayam</jats:p>
